function App() {






  const d = require('./activities.json')

  return (

<div className="App">
  <p className="Countdown">
       Productivity Tracker 
      <Countdown />
  </p>
  <div className="Table" style={{display: "flex",justifyContent: "center",
    alignItems: "center", backgroundColor: "#E0E0E0"}}>

    <JsonToTable json={d['activities']}/>

  </div>

</div>



  );
}

export default App;
